INFO:

In a world where money, fame, sex and power are part of daily life, follow the adventures of three beautiful footballers' 
wives. Married to famous sportsmen, they live in luxurious villas and are used to dressing in the most stylish clothes and 
expensive fine lingerie. Every day they make it their duty to fulfill the desires and fantasies of their footballer husbands. 
The world of beautiful Lola changes immeasurably the day her husband is sent off during a crucial match. Alongside her 
friend Anna, Lola will use all her charms to preserve the good image of her husband. She is willing to do anything to keep 
her perfect lifestyle.


